//Styles
import style from '../styles/mainIcons.css';

//Images
import pqrs from '../images/pqrs.png';
import news from '../images/news.png';
import developments from '../images/developments.png';


function MainIcons(){
    return(
        <div className="main-icons-container">
        
            <div  className="pqrs-container">


            </div>

            <div className="news-container">

            </div>

            <div className="developments-container">

            </div>

        </div>
    )
}

export {MainIcons};
